using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Games.NBall.Common;

namespace Games.NBall.Core.Match
{
    public class MatchReportCache
    {
        #region Cache
        static readonly string[] s_matchStr = new string[2];
        static readonly byte[][] s_matchBin = new byte[2][];
        #endregion

        #region Singleton
        static readonly object s_lockObj = new object();
        static volatile MatchReportCache s_instnce = null;
        public readonly bool InitFlag = false;
        public static MatchReportCache Instance()
        {
            if (null == s_instnce || !s_instnce.InitFlag)
            {
                lock (s_lockObj)
                {
                    if (null == s_instnce || !s_instnce.InitFlag)
                    {
                        s_instnce = new MatchReportCache();
                    }
                }
            }
            return s_instnce;
        }
        #endregion

        #region .ctor
        private MatchReportCache()
        {
            try
            {
                s_matchStr[0] = @"";
                //s_matchStr[1] = @"";
                for (int i = 0; i < s_matchStr.Length; i++)
                {
                    if (!string.IsNullOrEmpty(s_matchStr[i]))
                        s_matchBin[i] = System.Convert.FromBase64String(s_matchStr[i]);
                }
                this.InitFlag = true;
            }
            catch (Exception ex)
            {
                LogHelper.Insert(ex, "MatchReportCache:Init");
                this.InitFlag = false;
            }
        }
        #endregion

        #region Facade
        public byte[] GetReport()
        {
            return s_matchBin[0];
        }
        #endregion


    }
}
